def main():
    lines = actual_input.strip().split("\n")
    input = [list(line) for line in lines]
    rolls_of_paper_count = 0
    count = -1

    while count != 0:
        count = 0
        for i, line in enumerate(input):
            for j, char in enumerate(line):
                line_indices = [i-1, i, i+1]
                char_indices = [j-1, j, j+1]

                if char != "@":
                    continue

                adjacent_char_count = 0

                for line_index in line_indices:
                    for char_index in char_indices:
                        if line_index == i and char_index == j:
                            continue
                        
                        if line_index >= 0 and line_index < len(input) and char_index >= 0 and char_index < len(input[0]) and input[line_index][char_index] == "@": adjacent_char_count += 1 

                if adjacent_char_count < 4:
                    input[i][j] = "x"
                    count += 1

        rolls_of_paper_count += count

    for line in input:
        print(line)
    print(f"Rolls of Paper: {rolls_of_paper_count}")

if __name__ == "__main__":
    main()